import React from "react";
import human from "../../../Image/human.jpg";
import human2 from "../../../Image/human2.jpg";
import "./NavTop.css";
import List from "../List/List";
import Modal from "../Modal/Modal";

const NavTop = () => {
  return (
    <div className="navtop">
      <div className="row in-profile">
        <div className="col ">
          <img src={human} alt="" width="65" className="rounded-circle" />
          <button type="button" class="btn btn-demo" data-toggle="modal" data-target="#myModal">
			<i className="fa fa-bars"></i>
		</button>
          {/* <!-- Modal --> */}
	<div class="modal left fade" id="myModal" tabindex="-1" role="dialog" aria-labelledby="myModalLabel">
		<div class="modal-dialog" role="document">
			<div class="modal-content">

				<div class="modal-header">
					<button type="button" class="close" data-dismiss="modal" aria-label="Close"><span aria-hidden="true">&times;</span></button>
					<h4 class="modal-title" id="myModalLabel"></h4>
				</div>

				<div class="modal-body">
					<p>Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid. 3 wolf moon officia aute, non cupidatat skateboard dolor brunch. Food truck quinoa nesciunt laborum eiusmod. Brunch 3 wolf moon tempor, sunt aliqua put a bird on it squid single-origin coffee nulla assumenda shoreditch et. Nihil anim keffiyeh helvetica, craft beer labore wes anderson cred nesciunt sapiente ea proident. Ad vegan excepteur butcher vice lomo. Leggings occaecat craft beer farm-to-table, raw denim aesthetic synth nesciunt you probably haven't heard of them accusamus labore sustainable VHS.
					</p>
				</div>

			</div>
		</div>
	</div>
        </div>
      </div>
    </div>
  );
};

export default NavTop;
